import NewsSection from '../components/NewsSection';

const CoursesPage = () => {
    return (
        <div>
            <Hero />
            <CourseSection />
            <TestimonialsSection />
            <StatsSection />
            <NewsSection />
        </div>
    );
};

export default CoursesPage;
